  [],\n\t\"revision_timestamp\": \"2013-03-15T09:36:24.312544\",\n\t\"name\": \"field-plot-and-observation-points-for-fossil-butte-national-monument-vegetation-mapping-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This point file contains 255 point locations
  of field plot and observation data used by, and collected for, the vegetation mapping
  project for Fossil Butte National Monument. Plots and observation points were located
  subjectively in representative vegetation throughout the park. Field crews decided
  where and when to use observation points or vegetation plots to sample the vegetation.
  Vegetation plots (158) were placed in stands judged by field crews to represent
  legitimate vegetation types that could be classified to the National Vegetation
  Classification (NVC) system using standard multivariate analysis techniques. Observation
  points (97) were placed in stands (1) if the vegetation was highly altered and therefore
  not classifiable, (2) to provide information about the distribution of common vegetation
  types adequately sampled in vegetation plots, or (3) if the stand represented a
  unique vegetation type that was too small to hold a 400m2 sample plot. Plot and
  observation locations were collected in the summer of 2005 and were GPSed (primarily
  using recreational GPS units), coordinates noted on the field sheets and then transcribed
  into the MS Access Plots database. For 22 plot locations, fuels data was also collected.
  Field photos are associated with each plot.\",\n\t\"license_title\": null,\n\t\"extras\":
